import { Row, Col } from 'antd';
import { Link } from 'react-router-dom';
import logo from '../images/signup-logo.png';


export default function RegisterCard() {
    return(
        <div className="registerCard-bg">
            <div className="card">
                <div className="card-head">
                    <img src={logo} />
                </div>
            </div>
        </div>
    );
}
